import React from 'react'
import AsideProfile from './AsideProfile'
import AsideLogin from './AsideLogin'
import AsideCreateAccount from './AsideCreateAccount'
import AsideAbout from './AsideAbout'
import AsideFinances from './AsideFinances'

class Aside extends React.Component{
	render(){
		return(
		<div className='aside'>
			<AsideProfile />
            <AsideFinances expense={this.props.expense} amount={this.props.amount} formSubmit={this.props.formSubmit} />
            <AsideLogin />
            <AsideCreateAccount />
            <AsideAbout />
		</div>
		)
	}
}

export default Aside
